import React from 'react';
import './Quote.css';
import Media from 'react-media';
import { TweenMax, Expo } from 'gsap';

// Quote view Compoennt 
export default function REturnQuOte() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => {
 return (
  <div className='wrp-quote-regist-success'>
   <ViewText />
  </div>
 )
}
export const ScreenSmall = () => {
 return (
  <div className='wrp-quote-regist-success-sm'>
   <ViewText />
  </div>
 )
};
export const ViewText = () => {

 React.useEffect(() => {
  TweenMax.from('.Anima', 1.3, { delay: 1.8, opacity: 0, y: 20, ease: Expo.easeIn });
 }, []);

 return (
  <p className='Anima'>
   L'agent vient d'être ajouté avec succès à la base de données.Muunganomoney database
  </p>
 )
}
